export const TransactionHistory = ({ transactions }) => {
  return (
    <TableTransaction>
      <THeadTransaction>
        <TrTransaction>
          <ThTransaction>Type</ThTransaction>
          <ThTransaction>Amount</ThTransaction>
          <ThTransaction>Currency</ThTransaction>
        </TrTransaction>
      </THeadTransaction>

      <TBodyTransaction>
        {transactions.map(({ type, amount, currency }) => {
          return (
            <tr>
              <td>Invoice</td>
              <td>125</td>
              <td>USD</td>
            </tr>
          );
        })}
      </TBodyTransaction>
    </TableTransaction>
  );
};
